import React from 'react';
import { Container, Row, Col, Image, Button} from 'react-bootstrap';

const Header = () => {

  return(
    <Container>
      <Row>
        <Image src="nvidia-logo.jpeg" style={{"height":"50px", "width":"50px"}} roundedCircle />
        <p>Nvidia</p>
        <Button className="pull-right" variant="link">...</Button>
      </Row>
    </Container>
  );
}

export default Header;
